  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'project1';
  @Output() new_city=new EventEmitter<any>();


  cityName:string='';
  SetCity1(){
    this.new_city.emit("New York");
    console.log(this.new_city);

  }
}
